import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './components/header/header.jsx';
import Main_section from './components/main/main.jsx';
import Other_section from './components/other/other.jsx';
import Footer from './components/footer/footer.jsx';
import Catalog from './components/catalog/catalog.jsx';
import ItemPage from './components/item/item.jsx';
import './App.css';

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearch = (query) => setSearchQuery(query);

  return (
    <BrowserRouter>
      <SearchBar onSearch={handleSearch} />
      <Routes>
        <Route path="/catalog" element={<CatalogPage searchQuery={searchQuery} />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
